import TraderTable from './TraderTable';
import NavBar from './NavBar';
import { renderMatches } from 'react-router-dom';


const HomePage = (props)=>{
    
    render(); {
        const [nav, trade] = this.props.children;

        <div>
            {nav}
            {trade}
        </div>
    };
    
}
export default HomePage;
